import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; 2024 Saksham Rana. Software Developer & Cloud Solutions Specialist.</p>
        <p className="footer-subtitle">Passionate about creating impactful solutions and staying on the cutting edge of technology.</p>
      </div>
    </footer>
  );
};

export default Footer;
